- proto: Paper
  entities:
  - uid: 826
    components:
    - desc: A set of basic steps to follow to get your Hauler-class vessel up and running!
      name: Preflight Checklist
      type: MetaData
    - pos: 4.5164165,0.5656277
      parent: 1
      type: Transform
    - stampState: paper_stamp-ce
      stampedBy:
      - stampedBorderless: False
        stampedColor: '#C69B17FF'
        stampedName: stamp-component-stamped-name-ce
      - stampedBorderless: False
        stampedColor: '#00BE00FF'
        stampedName: stamp-component-stamped-name-approved
      content: >+
        [head=1]  =======================[/head]

        [head=1]   Hauler-class Salvage Ship[/head]

        [head=1] [/head]

        [head=1]      PREFLIGHT CHECKLIST[/head]

        [head=1]  =======================[/head]


        [head=2]1. Power supply.[/head]

        [head=3]1.1. Battery units.[/head]

        [bullet/][ ] Check if the substation unit is anchored to the floor.

        [bullet/][ ] Check if all APC units Main Breakers are toggled on.

        [bullet/][ ] Check the APC units current Loads[bold]*[/bold] (W).

        [head=3]1.2. S.U.P.E.R.P.A.C.K.M.A.N. generator unit.[/head]

        [bullet/][ ] Check if the S.U.P.E.R.P.A.C.K.M.A.N. generator unit is anchored to the floor.

        [bullet/][ ] Check if the S.U.P.E.R.P.A.C.K.M.A.N. generator unit has fuel. For extended flights make sure that you have enough fuel stockpiled to sustain prolonged power generation.

        [bullet/][ ] Check if the S.U.P.E.R.P.A.C.K.M.A.N. generator unit is set to HV output.

        [bullet/][ ] Set Target Power for 30-35[bold]**[/bold] [bold]k[/bold]W.

        [bullet/][ ] Start the S.U.P.E.R.P.A.C.K.M.A.N. generator unit.


        [head=2]2. Atmospherics.[/head]

        [head=3]2.1. Distribution Loop.[/head]

        [bullet/][ ] Check if the air canister is anchored to connector port.

        [bullet/][ ] Check if the distribution pump is set to normal pressure.

        [bullet/][ ] Enable distribution pump.

        [head=3]2.2. Waste Loop.[/head]

        [bullet/][] The Hauler-Class ship waste loop will self regulate and does not require setup. The passive exhaust port can be found outside the back airlock, you will require EVA.


        [head=2]3. Other checks.[/head]

        [bullet/][ ] Check if the gyroscope is anchored, powered, and enabled. It is located outside of the back airlock, you will require EVA. It should come properly installed already when you purchase your ship.

        [bullet/][ ] Check if the mini gravity generator is anchored, powered, and enabled inside the engine room.


        __________________________________________________________________

        [bold]*[/bold] - Hauler-class salvage ships are equipped with three APC units that can be used to appraise the ship's total power consumption. One can check the ship's total power consumption against the S.U.P.E.R.P.A.C.K.M.A.N. generator unit Target Power output: to keep substation and APCs fully charged, S.U.P.E.R.P.A.C.K.M.A.N. generator unit Target Power output should exceed the combined load of all APCs. Remember to check APC Loads and adjust the generator unit Target Power after connecting new power-consuming machines. The average combined load of all APCs on a stock model Hauler-class ship is 27'000W when idle.

        [bold]**[/bold] - Hauler-class salvage ships have high power demand meaning that the S.U.P.E.R.P.A.C.K.M.A.N. generator unit's Target Power value should be kept no lower than 30 kW for optimal performance. Please note, that recommended Target Power value to avoid blackouts during Gravity Generator charging sequence is 35 kW.

        [bold]Note:[/bold] Without a working generator, fully charged battery units (SMES and substation) in unmodified Hauler-class salvage ships can provide power for approximately 5 minutes before fully depleting their charge.


      type: Paper
